// Buyback.jsx
import React, { useEffect, useState } from "react";
import { ethers } from "ethers";
import { useTranslation } from "react-i18next";
import HAYQAbi from "../abis/HAYQMiniMVP.json";

export default function Buyback({ contractAddress, account }) {
  const { t } = useTranslation();
  const [isOwner, setIsOwner] = useState(false);
  const [contractBalance, setContractBalance] = useState("0");
  const [amount, setAmount] = useState("100");
  const [minOut, setMinOut] = useState("0.01");
  const [loading, setLoading] = useState(false);
  const [status, setStatus] = useState("");

  useEffect(() => {
    if (!window.ethereum || !contractAddress) return;

    const init = async () => {
      try {
        const provider = new ethers.BrowserProvider(window.ethereum);
        const contract = new ethers.Contract(contractAddress, HAYQAbi, provider);

        // Owner check
        let ownerAddress;
        try {
          ownerAddress = await contract.owner();
        } catch {
          ownerAddress = null;
        }
        setIsOwner(ownerAddress?.toLowerCase() === account?.toLowerCase());

        // Contract balance
        const bal = await contract.balanceOf(contractAddress);
        setContractBalance(ethers.formatUnits(bal, 18));
      } catch (err) {
        console.error("Buyback init error:", err);
      }
    };

    init();
  }, [contractAddress, account]);

  const triggerBuyback = async () => {
    if (!window.ethereum || !contractAddress) return;

    if (!isOwner) {
      setStatus(t("ownerOnlyNotice"));
      return;
    }

    setLoading(true);
    setStatus(t("buyback_pending"));

    try {
      const provider = new ethers.BrowserProvider(window.ethereum);
      const signer = await provider.getSigner();
      const contract = new ethers.Contract(contractAddress, HAYQAbi, signer);

      const tokenAmount = ethers.parseUnits(amount || "0", 18);
      const minOutUnits = ethers.parseUnits(minOut || "0", 18);

      const contractBalBN = await contract.balanceOf(contractAddress);
      if (contractBalBN.lt(tokenAmount)) {
        setStatus(t("buyback_insufficient_contract_balance") || "Insufficient contract balance");
        setLoading(false);
        return;
      }

      const tx = await contract.buyback(tokenAmount, minOutUnits, { gasLimit: 500000 });
      setStatus(`${t("txSent")}: ${tx.hash}`);
      await tx.wait();
      setStatus(t("buyback_success"));

      const newBal = await contract.balanceOf(contractAddress);
      setContractBalance(ethers.formatUnits(newBal, 18));
    } catch (err) {
      console.error("Buyback error:", err);
      const message = err?.error?.message || err?.message || String(err);
      setStatus(`${t("buyback_failed")}: ${message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="component">
      <h3>{t("buyback")}</h3>

      <p><b>{t("contractBalance")}:</b> {contractBalance} HAYQ</p>

      {!isOwner && (
        <p style={{ color: "orange" }}>
          {t("ownerOnlyNotice") || "Only owner can execute buyback."}
        </p>
      )}

      {isOwner && (
        <div style={{ display: "flex", gap: 8, marginTop: 8 }}>
          <input
            type="number"
            min="0"
            step="1"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            placeholder={t("tokenAmount") || "Amount"}
          />
          <input
            type="number"
            min="0"
            step="0.01"
            value={minOut}
            onChange={(e) => setMinOut(e.target.value)}
            placeholder={t("minOut") || "Min out"}
          />
          <button
            className="primary"
            disabled={loading}
            onClick={triggerBuyback}
          >
            {loading ? t("processing") : t("buyback_trigger")}
          </button>
        </div>
      )}

      {status && <p>{status}</p>}
    </div>
  );
}
